import React from 'react';
import { Link } from 'react-router-dom';

export default function News() {
    return(
        <div className="fakeNews">
          <h1>Latest News</h1>
          <h3>Stocks, Bonds, Dividends: Working Boys</h3>
          <img src="http://localhost:8080/documents/20123/0/business+calls.jpg/fe507a0f-c5cc-89d0-ecae-37a4adc3b06a?t=1645741413455" className="picture" alt="businesscalls" />
          <h4>Professor Hidgens</h4>
          <Link to="/details1">Read More</Link>
          <br/>
          <h3>Business. I Love Business</h3>
          <img src="http://localhost:8080/documents/20123/0/business.jpg/e8ab00c3-9dea-e61c-d951-473cb785337f?t=1645741290790" className="picture" alt="business" />
          <h4>Sam Eagle</h4>
          <Link to="/details2">Read More</Link>
          <br/>
          <h3>Money, Money, Money. Is It Actually Funny?</h3>
          <img src="http://localhost:8080/documents/20123/0/money+money.jpg/43bf4c86-3313-57b7-8b53-10058ca2f595?t=1645741587122" className="picture" alt="moneymoney" />
          <h4>Benny Andersson</h4>
          <Link to="/details3">Read More</Link>
      </div>
    );
  };
